import React, { useState } from "react";
import axios from "axios";
import "../sass/ShowStyle/showstyle.css";
import left_result from "../img/result/left-result.png";
import right_result from "../img/result/right-result.png";
import read from "../img/box-chat/reading-img.png";

const ShowList = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");

  const fetchData = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "http://localhost:3001/api/create-list",
        {
          title,
          description,
        },
        {
          withCredentials: true,
        }
      );
      console.log(res);
      if (res === 201) {
        console.log("Succesfull");
      }
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <div className="flex w-full min-h-ma">
      <div className="px-12 w-full h-screen">
        <div className="relative flex w-full justify-between">
          <img
            className="absolute right-24 bottom-0 "
            src={right_result}
            alt=""
          />
          <img className="absolute" src={read} alt="" />
        </div>
        <div className="relative">
          <div className="absolute right-32 top-32">
            <div className="box_todo_list">
              <div className="show-title">
                dddddddddddddddddddddddddddddddddddddddddddddd ddddddd ddddddd
                ddddddd ddddddddddddddddddddddddddddddddd
              </div>
              <svg className="phone-svg">
                <polygon points="10,0 300,0 290,100 290,310 5,310" />
              </svg>
              <svg className="screen-border-svg1">
                <polygon points="20,10 280,10 280,300 250,300 20,302" />
              </svg>
              <svg class="screen-border-svg2">
                <polygon points="25,14 270,18 265,297 23,297" />
              </svg>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ShowList;
